import React, { Component } from 'react';
import SkillCard from './SkillCard';

class SkillSet extends Component {

  render() {
    const { setName, skills } = this.props;

    return (
      <div class='container'>
        <div class='row'>
          <div class='col-sm-4'>
            <p class='h3'>{setName}}</p>
          </div>
          <div class='col-sm-8'>
            <SkillCard />
          </div>
        </div>
      </div>
    )
  }
}

export default SkillSet;
